description:
DeepSea Under the Pole

Travel Documentary hosted by Ken Starcevic, published by National Geographic in 2010 - English narration


Information
------------------------------

DeepSea Under the Pole
Is a revolutionary pioneer expedition and an innovative human
adventure that combines ski trekking and scuba diving in one of the toughest climates on the planet This crew of eight young passionate divers, adventurers and explorers - in celebration of a century of conquest of the North Pole - represent the first time man will cover such a long distance, over 800km, while also executing dives at remote sites that reveal the hidden side of the polar ice cap; something never before seen by humankind. The focus of the expedition is to commemorate the hidden and difficult-to-access underside of the polar ice cap, a spectacular World Heritage Site that is now disappearing due to climate change. This vast upside-down universe is home to huge icy ceilings above and a seemingly invisible bottom below, rich with other mysteries. It is a universe of water and ice - a world of polar white, deep black, emerald green and clear turquoise.

